<!doctype html>
<html>
<head>
	<meta http-equiv="Content-type" content="text/html; charset=utf-8">
	<title>jQuery selector - sizzle cache</title>

	<script>
		if ( parent.location.search.search( /(\?|&)closureCompiler=true/ ) >= 0 ) {
			document.write( "<script src='../../../build/closure-compiler/jquery_compiled.js'><\/script>" );
			document.write( "<script src='../../../build/closure-compiler/sizzle_cache_data.js'><\/script>" );
		} else {
			document.write( "<script src='../../../dist/jquery.js'><\/script>" );
			document.write( "<script src='sizzle_cache.js'><\/script>" );
		}
	</script>
	<script src="../../../dist/jquery.min.js"></script>
</head>
<body>

	<div class="test">
		<a href="#" id="collision">Worlds collide</a>
	</div>

</body>
</html>
